import {NavLink} from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div>
        <NavLink to="/stars">Второе задание</NavLink>
      </div>
      <div>
        <NavLink to="/tags">Третье задание</NavLink>
      </div>
      <div>
        <NavLink to="/pagination">Четвертое задание</NavLink>
      </div>
    </div>
  );
};

export default Navbar;
